ight handed shooters. And they run like $200 by themselves. Can't be used with the scope mount on though.<br/> -I have 120 rounds silver bear fmj, and 84 rounds hornady ballistic tips<br/> -the for end is tapco with a magpul grip<br/> -the stock is ati and has an adjustable cheek piece<br/> -has a hogue pistol grip as well<br/> Paint was done by previous owner. Idk how it was done, but its holding up well.<br/> <br/> This is the smoothest shooting AK you will ever shoot. There is virtually no recoil, and its a blast to shoot. The only reason its for sale is that im just trying to consolidate calibers.<br/> <br/> NO FELONS, MINORS OR LOWBALLERS<br/> MO RESIDENTS FACE TO FACE<br/> KS RESIDENTS THROUGH FFL"}
