{"a": "http://schema.org/Offer", "availableAtOrFrom": "_:schema_Place1_b8927fe121eb42b9e3eb12fba67ba43ac2a1e479_N60", "name": "New XLP Adams Arms Piston Kit w/Upgraded Complete VDI Low Mass BCG", "price": "350", "uri": "_:schema_Offer1_bc5dd045b8623ddfc4bd0bce98ca5fda42accf88_N53_c5ba76fb98006f10509c20a3a950c0e8677f61a4_N51_89a1c105a4720482e52ae423839ed97c693201ca_N52_0a15dec898b98eabf546f2dd0910df757974eb24_N61", "seller": "_:memex_PersonOrOrganization1_d8960f83c81f95f33fc16136cbf9f347c1b410b4_N57", "availabilityStarts": "Sunday", "itemOffered": "_:memex_Firearm1_0e8f9ebbf90b6b80705218b31f7ec0e1e165b2f0_N48", "mainEntityOfPage": "_:schema_CreativeWork1_6a4d8e11cca9c5a276a8e76d190c78329e8242a9_N59_465683a61c72b6e9d1df9e6e5fbfddccc064dfe2_N49_232e2da92ba3141012f09ddd6efd7ccff9255248_N65_31df2a2fe24e7fcaf2f1ba0a3cab9b94fe0d8170_N58_3f34717fbf7f4f96f84c687ceba0f696c0a43e79_N56_d66b92b712d2f2cab542d9abab0b2bd8d651afa1_N47_c8a895d48fb38fb3883a22b63cadd38fa072cea9_N54_3a987a31bba843bfac7ca34db2464958877cb1c7_N55_01b11b323315f61a7f9f657f382475e9cf83a842_N63_d96a0cbff54189bb75ea019311b9a57a21db9690_N62", "@context": "https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/development/versions/3.0/karma/karma-context.json", "description": "LNIB AA Piston kit with upgraded complete Voodoo Innovations low mass BCG. I put this on a Short Barrel Rifle and shot a 20 round box of Gemtech 300BLK 187 Subs with it and then traded the upper minus the piston kit to a friend. It comes with the complete AA kit plus the full BCG and a pistol length drive rod, the ID of the gas block is .750\"<br/> <br/> This design of this piston system is just incredible, especially when shot suppressed. It has 5 different gas settings for numerous applications (ie, subsonic) and is unique in that it can fit under most handguards that use a standard barrel nut, instead of having the block poking up in front of the handguard and disrupting the profile. It also is legitimately self-cleaning, and designed to shoot around 10,000 rounds before requiring to be cleaned. These kits are for a mid-length setup, but pistol, carbine and rifle length drive rods can be purchased separately from Adams Arms to fit whatever length is required.<br/> <br/> These run between $360-$380 + s/h + tax depending on where you buy them and that's without the VDI Lifecoat complete bolt that I have. The complete Lifecoat VDI bolts are between $55-$80 before shipping and or taxes. <br/> <br/> Here is the description from AA's website: <br/> <br/> This system will work with .223/5.56 x 45 mm NATO and 300BLK<br/> <br/> Kit includes:<br/> <br/> Patented One-Piece Low Mass Bolt Carrier<br/> XLP Multi-Adjustable Low Profile Gas Block<br/> Gas Plug<br/> Bushing Installation Rod<br/> Bolt Spring<br/> Drive Rod with Bushing and Spring<br/> Installation DVD<br/> The Adams Arms Piston System:<br/> <br/> A short stroke free floating piston system.<br/> Is Self-Cleaning.<br/> Carbon and gases are expelled forward, away from operator.<br/> Corrosive resistant coating processes.<br/> Harmonics are not transferred into the barrel.<br/> Adjustable gas settings for various applications.<br/> Doesn't vent directly to atmospheric pressure; this eliminates flash signature and super sonic crack which is optimal for night vision and suppresses fire.<br/> <br/> I am willing to ships a well, add $25 for shipping within the lower 48. I also have more pictures if needed as well as the original foam box and packaging."}
